import * as React from 'react';
import './App.css';
import {Pokemon} from "./model/Pokemon";
import {PokemonType} from "./model/PokemonType";
import {Page} from "./component/Page";

function App() {
    const[pageNumber, setPageNumber] = React.useState<number>(1);

    let electricType: PokemonType = {
        id: 0,
        name: "electric",
    }

    let waterType: PokemonType = {
        id: 0,
        name: "water",
    }

    let pikachu: Pokemon = {
        name: "Pikachu",
        weight: 15,
        height: 10,
        id: 1,
        types: [electricType, waterType]
    }
    return (
        <div className="App">
            <Page pageNumber={1}/>
        </div>
    );
}

export default App;
